import React from "react";
import {BrowserRouter, Route} from "react-router-dom";
import Navbar from "./components/UI/Navbar/Navbar";
import Profile from "./pages/Profile";


function App() {
  return (
          <BrowserRouter>
              <Route path="/profile">
                  <Profile/>
              </Route>
          </BrowserRouter>
  );
}

export default App;
